import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import {Banner} from "./componets/banner"
class Main extends React.Component {
    render() {
        return (
            <>
                <Banner />
            </>
        )
    }
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<Main />);
